import React from 'react';
import {
  BrowserRouter,
  Route,
  Switch,
  Redirect
} from 'react-router-dom';

import Homepage from './pages/Homepage';
import Page from './pages/Page';



function App() {


  return (

    <BrowserRouter>

      <Switch>
        {/* <Route exact path="/"> 
          <Redirect to="/en-gb" />
        </Route> */}

        <Route exact path='/:lang' component={Homepage} />
        <Route exact path='/:lang/:uid' component={Page} />

      </Switch>

    </BrowserRouter>
  );
}

export default App;
